import React, { Component } from 'react';
import { css } from 'emotion';

export default class Input extends Component {
    render() {
        return (
            <div>
                <input type={this.props.inputType} className={main} placeholder={this.props.inputPlaceholder}></input>
            </div>
        )
    }
}

const main = css`
    width: 20vw;
    height: 5vh;
    border-radius: 1px solid gray;
    border-radius: 5px;
`
